Generally, a functional test will be placed in tests/testsuite/<command>.rs and will look roughly like: #[cargo_test]
fn <description>() { let p = project() .file("src/main.rs", r#"fn main() { println!("hi!"); }"#) .build(); p.cargo("run --bin foo") .with_stderr( "\ [COMPILING] foo [..] [FINISHED] [..] [RUNNING] `target/debug/foo` ", ) .with_stdout("hi!") .run(); }
} The #[cargo_test] attribute is used in place of #[test] to inject some setup code. ProjectBuilder via project(): Each project is in a separate directory in the sandbox If you do not specify a Cargo.toml manifest using file(), one is automatically created with a project name of foo using basic_manifest(). Execs via p.cargo(...): This executes the command and evaluates different assertions See support::compare for an explanation of the string pattern matching. Patterns are used to make it easier to match against the expected output. #[cargo_test] attribute The #[cargo_test] attribute injects code which does some setup before starting the test. It will create a filesystem "sandbox" under the "cargo integration test" directory for each test, such as /path/to/cargo/target/tmp/cit/t123/. The sandbox will contain a home directory that will be used instead of your normal home directory. The #[cargo_test] attribute takes several options that will affect how the test is generated. They are listed in parentheses separated with commas, such as: #[cargo_test(nightly, reason = "-Zfoo is unstable")] The options it supports are: nightly --- This will cause the test to be ignored if not running on the nightly toolchain. This is useful for tests that use unstable options in rustc or rustdoc. These tests are run in Cargo's CI, but are disabled in rust-lang/rust's CI due to the difficulty of updating both repos simultaneously. A reason field is required to explain why it is nightly-only. build_std_real --- This is a "real" -Zbuild-std test (in the build_std integration test). This only runs on nightly, and only if the environment variable CARGO_RUN_BUILD_STD_TESTS is set (these tests on run on Linux). build_std_mock --- This is a "mock" -Zbuild-std test (which uses a mock standard library). This only runs on nightly, and is disabled for windows-gnu. requires_ --- This indicates a command that is required to be installed to be run. For example, requires_rustfmt means the test will only run if the executable rustfmt is installed. These tests are always run on CI. This is mainly used to avoid requiring contributors from having every dependency installed. >=1.64 --- This indicates that the test will only run with the given version of rustc or newer. This can be used when a new rustc feature has been stabilized that the test depends on. If this is specified, a reason is required to explain why it is being checked. public_network_test --- This tests contacts the public internet. These tests are disabled unless the CARGO_PUBLIC_NETWORK_TESTS environment variable is set. Use of this should be extremely rare , please avoid using it if possible. The hosts it contacts should have a relatively high confidence that they are reliable and stable (such as github.com), especially in CI. The tests should be carefully considered for developer security and privacy as well. container_test --- This indicates that it is a test that uses Docker. These tests are disabled unless the CARGO_CONTAINER_TESTS environment variable is set. This requires that you have Docker installed. The SSH tests also assume that you have OpenSSH installed. These should work on Linux, macOS, and Windows where possible. Unfortunately these tests are not run in CI for macOS or Windows (no Docker on macOS, and Windows does not support Linux images). See crates/cargo-test-support/src/containers.rs for more on writing these tests. ignore_windows="reason" --- Indicates that the test should be ignored on windows for the given reason. Testing Nightly Features If you are testing a Cargo feature that only works on "nightly" Cargo, then you need to call masquerade_as_nightly_cargo on the process builder and pass the name of the feature as the reason, like this: p.cargo("build").masquerade_as_nightly_cargo(&["print-im-a-teapot"]) If you are testing a feature that only works on nightly rustc (such as benchmarks), then you should use the nightly option of the cargo_test attribute, like this: #[cargo_test(nightly, reason = "-Zfoo is unstable")] This will cause the test to be ignored if not running on the nightly toolchain. Specifying Dependencies You should not write any tests that use the network such as contacting crates.io. Typically, simple path dependencies are the easiest way to add a dependency. Example: let p = project() .file("Cargo.toml", r#" [package] name = "foo" version = "1.0.0" [dependencies] bar = {path = "bar"} "#) .file("src/lib.rs", "extern crate bar;") .file("bar/Cargo.toml", &basic_manifest("bar", "1.0.0")) .file("bar/src/lib.rs", "") .build(); If you need to test with registry dependencies, see support::registry::Package for creating packages you can depend on. If you need to test git dependencies, see support::git to create a git dependency. Cross compilation There are some utilities to help support tests that need to work against a target other than the host. See Running cross tests for more an introduction on cross compilation tests. Tests that need to do cross-compilation should include this at the top of the test to disable it in scenarios where cross compilation isn't available: if cargo_test_support::cross_compile::disabled() { return;
} The name of the target can be fetched with the cross_compile::alternate() function. The name of the host target can be fetched with cargo_test_support::rustc_host() . The cross-tests need to distinguish between targets which can build versus those which can actually run the resulting executable. Unfortunately, macOS is currently unable to run an alternate target (Apple removed 32-bit support a long time ago). For building, x86_64-apple-darwin will target x86_64-apple-ios as its alternate. However, the iOS target can only execute binaries if the iOS simulator is installed and configured. The simulator is not available in CI, so all tests that need to run cross-compiled binaries are disabled on CI. If you are running on macOS locally, and have the simulator installed, then it should be able to run them. If the test needs to run the cross-compiled binary, then it should have something like this to exit the test before doing so: if cargo_test_support::cross_compile::can_run_on_host() { return;
}

