UI Tests are a bit more spread out and generally look like: tests/testsuite/<command>/mod.rs: mod <case>; tests/testsuite/<command>/<case>/mod.rs: use cargo_test_support::prelude::*;
use cargo_test_support::compare::assert_ui;
use cargo_test_support::Project;
use cargo_test_support::curr_dir; #[cargo_test]
fn case() { let project = Project::from_template(curr_dir!().join("in")); let project_root = project.root(); let cwd = &project_root; snapbox::cmd::Command::cargo_ui() .arg("run") .arg_line("--bin foo") .current_dir(cwd) .assert() .success() .stdout_matches_path(curr_dir!().join("stdout.log")) .stderr_matches_path(curr_dir!().join("stderr.log")); assert_ui().subset_matches(curr_dir!().join("out"), &project_root);
} Then populate tests/testsuite/<command>/<case>/in with the project's directory structure tests/testsuite/<command>/<case>/out with the files you want verified tests/testsuite/<command>/<case>/stdout.log with nothing tests/testsuite/<command>/<case>/stderr.log with nothing #[cargo_test]: This is used in place of #[test] This attribute injects code which does some setup before starting the test, creating a filesystem "sandbox" under the "cargo integration test" directory for each test such as /path/to/cargo/target/cit/t123/ The sandbox will contain a home directory that will be used instead of your normal home directory Project: The project is copied from a directory in the repo Each project is in a separate directory in the sandbox Command via Command::cargo_ui(): Set up and run a command. OutputAssert via Command::assert(): Perform assertions on the result of the Command Assert via assert_ui(): Verify the command modified the file system as expected Updating Snapshots The project, stdout, and stderr snapshots can be updated by running with the SNAPSHOTS=overwrite environment variable, like: $ SNAPSHOTS=overwrite cargo test Be sure to check the snapshots to make sure they make sense. Testing Nightly Features If you are testing a Cargo feature that only works on "nightly" Cargo, then you need to call masquerade_as_nightly_cargo on the process builder and pass the name of the feature as the reason, like this: snapbox::cmd::Command::cargo() .masquerade_as_nightly_cargo(&["print-im-a-teapot"]) If you are testing a feature that only works on nightly rustc (such as benchmarks), then you should use the nightly option of the cargo_test attribute, like this: #[cargo_test(nightly, reason = "-Zfoo is unstable")] This will cause the test to be ignored if not running on the nightly toolchain.
